This shoot takes you into Jade's darkest fantasy of being abducted, fucked by a group of men, and locked away indefinitely for them to use whenever they desire. In her fantasy she searches for her car keys when a van pulls up next to her and she is snatched up and driven away. Try as she might to escape she is outnumbered, overpowered, and incapable of getting away. Helpless and bound she is made to service the men in every way possible, and with every hole possible.
